import React, { useEffect, useState } from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import './TableGastos.css';

function createData(nome, desc, valor) {
    return {nome, desc, valor};
}

const rows = [
    createData('Frozen yoghurt', 159, 6.0),
    createData('Ice cream sandwich', 237, 9.0),
    createData('Eclair', 262, 16.0),
    createData('Cupcake', 305, 3.7),
    createData('Gingerbread', 356, 16.0),
];

const TableGastos = () => {

    const [gastos, setGastos] = useState([]);

    const fetchGastos = async () => {
        const response = await fetch('/api');
        console.log(response);
        const body = await response.json();
        setGastos(body);
    }

    const showGastos = () => {
        gastos.map((gasto) => console.log(gasto.nome));
    }

    useEffect(() => {
        fetchGastos();
        showGastos();
    }, []);

    return (
            <TableContainer component={Paper}>
                <Table sx={{minWidth: 650}} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell><b>Nome</b></TableCell>
                            <TableCell align="right"><b>Descrição</b></TableCell>
                            <TableCell align="right"><b>Valor</b></TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {gastos.map((gasto) => (
                            <TableRow
                                key={gasto.nome}
                                sx={{'&:last-child td, &:last-child th': {border: 0}}}
                            >
                                <TableCell component="th" scope="row">
                                    {gasto.nome}
                                </TableCell>
                                <TableCell align="right">{gasto.desc}</TableCell>
                                <TableCell align="right">{gasto.valor}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
    );
};

export default TableGastos;
